import HeaderImg from "./Images/header.jpg";
import "./header.css";
const Header = () =>{
    return (
        <>
            {/* Header */}
            <div className="header">
                <div className="img">
                    <div>
                        <img src={HeaderImg} alt=""/>
                    </div>
                    <div className="Overlay"></div>
                </div>
                <div className="Content">
                <h6>Cars king</h6> 
                <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Velit quidem sequi a ea quod beatae nostrum eos, temporibus modi ab nobis totam blanditiis doloribus quibusdam eligendi repellat sint error quis accusamus veniam voluptatum eaque architecto numquam recusandae! Mollitia ab perferendis accusamus odio, dicta velit, inventore sed, repudiandae quos molestiae nisi eius? Dicta omnis ducimus, nesciunt non cum in minus sapiente odio modi doloremque rem deserunt corrupti temporibus beatae numquam eligendi iure sunt debitis porro nulla. Voluptate, totam earum magnam nesciunt perferendis esse cupiditate necessitatibus et. Obcaecati alias odio labore, ratione est debitis asperiores ea cumque nemo dolores. Iusto, voluptatem veritatis.
                </p>
                <button className="btn">Read More</button>
                </div>
            </div>   
        </>
    );
};

export default Header;
